from collections import deque

def minPath(grid, k):
    N = len(grid)
    directions = [(0, 1), (1, 0), (0, -1), (-1, 0)]  # Right, Down, Left, Up

    def bfs(start_row, start_col):
        queue = deque([(start_row, start_col, [grid[start_row][start_col]])])
        visited = set((start_row, start_col))

        while queue:
            row, col, path = queue.popleft()

            if len(path) == k:
                return path

            for dr, dc in directions:
                new_row, new_col = row + dr, col + dc
                if 0 <= new_row < N and 0 <= new_col < N and (new_row, new_col) not in visited:
                    visited.add((new_row, new_col))
                    queue.append((new_row, new_col, path + [grid[new_row][new_col]]))

        return None

    min_path = None

    for i in range(N):
        for j in range(N):
            path = bfs(i, j)
            if path and (min_path is None or path < min_path):
                min_path = path

    return min_path

