print(order_by_points([]))  # Output: []

def specialFilter(nums):
    def is_odd(digit):
        return digit in [1, 3, 5, 7, 9]

    def first_digit(num):
        num = abs(num)
        while num >= 10:
            num //= 10
        return num

    def last_digit(num):
        return num % 10

    count = 0
    for num in nums:
        if num > 10 and is_odd(first_digit(num)) and is_odd(last_digit(num)):
            count += 1
    return count

