def get_max_triples(n):
    # Step 1: Generate the array a
    a = [i * i - i + 1 for i in range(1, n + 1)]

    # Step 2: Initialize the count of valid triples
    count = 0

    # Step 3: Iterate through all possible triples (i, j, k)
    for i in range(n):
        for j in range(i + 1, n):
            for k in range(j + 1, n):
                # Step 4: Check if the sum of the triple is a multiple of 3
                if (a[i] + a[j] + a[k]) % 3 == 0:
                    count += 1

    return count

# Example usage:
n = 5
print(get_max_triples(n))  # Output: 1

def bf(planet1, planet2):
    planets = ["Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"]

    if planet1 not in planets or planet2 not in planets:
        return ()

    index1 = planets.index(planet1)
    index2 = planets.index(planet2)

    if index1 > index2:
        index1, index2 = index2, index1

    result = planets[index1 + 1:index2]
    return tuple(result)

# Examples
print(bf("Jupiter", "Neptune"))  # ==> ("Saturn", "Uranus")
print(bf("Earth", "Mercury"))    # ==> ("Venus")
print(bf("Mercury", "Uranus"))   # ==> ("Venus", "Earth", "Mars", "Jupiter", "Saturn")

def compare(game, guess):
    result = []
    for i in range(len(game)):
        if game[i] == guess[i]:
            result.append(0)
        else:
            result.append(abs(game[i] - guess[i]))
    return result

